  {
   "cell_type": "markdown",
   "id": "871bcd94",
   "metadata": {},
   "source": [
    "Mengatasi outlier menggunakan metode IQR"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 1266,
   "id": "06ce3d28",
   "metadata": {},
   "outputs": [
    {
     "data": {
      "text/plain": [
       "(5639, 12)"
      ]
     },
     "execution_count": 1266,
     "metadata": {},
     "output_type": "execute_result"
    }
   ],
   "source": [
    "# Ambil hanya kolom numerikal\n",
    "numeric_cols = numeric_feature\n",
    "# Hitung Q1, Q3, dan IQR hanya untuk kolom numerikal\n",
    "Q1 = df[numeric_cols].quantile(0.25)\n",
    "Q3 = df[numeric_cols].quantile(0.75)\n",
    "IQR = Q3 - Q1\n",
    "# Buat filter untuk menghapus baris yang mengandung outlier di kolom numerikal\n",
    "filter_outliers = ~((df[numeric_cols] < (Q1 - 1.5 * IQR)) |\n",
    "                    (df[numeric_cols] > (Q3 + 1.5 * IQR))).any(axis=1)\n",
    "# Terapkan filter ke dataset asli (termasuk kolom non-numerikal)\n",
    "df = df[filter_outliers]\n",
    "# Cek ukuran dataset setelah outlier dihapus\n",
    "df.shape"
   ]
  },
